const ImagesApi = {
    original: (imgPath) => (
    `https://image.tmdb.org/t/p/original/${imgPath}`
    ),
    w500Image: (imgPath) => (
    `https://image.tmdb.org/t/p/w500/${imgPath}`
    )
}

export default ImagesApi;
